import React from 'react';
import '../styles/App.css';

const BioSection = () => (
  <section className="bio">
    <h2>About Mamta Enterprises</h2>
    <p>
      Trusted local logistics and shifting company. Affordable, reliable, and professional services for residential, office, and goods transport.
    </p>
  </section>
);

export default BioSection;
